import{C as p}from"./app.4308d17d.js";import{_ as r}from"./plugin-vue_export-helper.21dcd24c.js";const e={},t=p("<p>\u592A\u957F\u4E0D\u770B\u7248\uFF1A\u987A\u4F4D\u7B2C\u4E00\u7684\u65B0\u5E74\u613F\u671B\u662F\u80FD\u6210\u4E3A\u4E00\u4E2A\u6E29\u6696\u7684\u4EBA\u7C7B\uFF0C\u5982\u679C\u8FD9\u4E2A\u613F\u671B\u4ECA\u5E74\u65E0\u6CD5\u5B9E\u73B0\uFF0C\u90A3\u5C31\u5148\u5F53\u4E00\u4E2A\u6B63\u5E38\u4E00\u4E9B\u7684\u4EBA\u7C7B\u5427\u3002\u7136\u540E\uFF0C\u5E0C\u671B\u4ECA\u5E74\u80FD\uFF08\u5728\u751F\u5B58\u7387\u8F83\u9AD8\u7684\u524D\u63D0\u4E0B\uFF09\u6709\u4E66\u8BFB\uFF0C\u5E0C\u671B\u8FD9\u4E2A\u4E16\u754C\u80FD\u514D\u4E8E\u9E66\u9E49\u7684\u56F0\u6270\uFF0C\u55F7\u3002</p><hr><p>\u6211\u5728\u6BD5\u4E1A\u8BBA\u6587\u81F4\u8C22\u91CC\u5199\uFF0C\u8FD9\u4E2A\u516D\u6708\u65E0\u6CD5\u4E0D\u8BA9\u6211\u60F3\u8D77\u56DB\u5E74\u524D\u90A3\u4E2A\u9AD8\u8003\u6210\u7EE9\u610F\u6599\u4E4B\u5185\u7684\u4E0D\u600E\u4E48\u6837\uFF0C\u81EA\u62DB\u53D1\u6325\u4E5F\u60C5\u7406\u4E4B\u4E2D\u7684\u6CA1\u6709\u5F88\u597D\uFF0C\u5374\u4F9D\u7136\u88AB\u540C\u6D4E\u8F6F\u9662\u964D\u5206\u635E\u4E86\u8FDB\u6765\u7684\u795E\u5947\u7684\u76DB\u590F\u3002</p><p>\u90A3\u65F6\u7ED9\u6211\u7684\u5370\u8C61\u6700\u6DF1\u523B\u7684\u662F\uFF0C\u4E00\u4E2A\u5FD7\u613F\u8005\u5B66\u59D0\u5728\u56DB\u5E73\u8DEF\u5357\u697C\u5C3D\u5934\u7684\u9636\u68AF\u6559\u5BA4\u91CC\u544A\u8BC9\u6211\u4EEC\uFF1A\u201C\u4E0D\u8981\u73A9\u624B\u673A\uFF0C\u540C\u6D4E\u6821\u89C4\u8981\u6C42\u4E0D\u80FD\u5728\u6559\u5BA4\u91CC\u73A9\u624B\u673A\u3002\u201D</p><p>\u6559\u5BA4\u91CC\u7684\u4EBA\u5927\u6982\u90FD\u8FD8\u5F88\u5929\u771F\uFF0C\u4E8E\u662F\u5927\u5BB6\u51E0\u4E4E\u90FD\u76F8\u4FE1\u4E86\u8FD9\u53E5\u8BDD\u3002</p><p>\u4E5F\u4E0D\u77E5\u9053\u73B0\u5728\u7684\u9AD8\u4E2D\u6BD5\u4E1A\u751F\u4EEC\u8FD8\u6709\u6CA1\u6709\u90A3\u4E48\u5BB9\u6613\u88AB\u9A97\u3002</p><hr><p>\u6211\u6CA1\u6709\u60F3\u5230\u7684\u662F\u6211\u5C45\u7136\u8FD8\u6709\u76F4\u63A5\u63ED\u7A7F\u8FD9\u4E2A\u8C0E\u8A00\u7684\u673A\u4F1A\u3002\u90A3\u4E00\u5929\u6211\u4EE5\u4E3A\u6211\u8D70\u51FA\u540C\u6D4E\u6821\u95E8\u4E4B\u540E\u5C31\u518D\u4E5F\u4E0D\u4F1A\u56DE\u6765\uFF0C\u6CA1\u60F3\u5230\u56DB\u5E74\u671D\u671D\u66AE\u66AE\uFF0C\u6211\u53C8\u5728\u540C\u6D4E\u8FCE\u6765\u4E86\u4E00\u4E2A\u53C8\u4E00\u4E2A\u7684\u590F\u5929\u3002</p><p>\u73B0\u5728\u60F3\u60F3\uFF0C\u9020\u6210\u6211\u6700\u540E\u6765\u540C\u6D4E\u7684\u662F\u4E00\u4E2A\u4E2A\u6577\u884D\u7684\u51B3\u5B9A\u3002\u81EA\u62DB\u5FD7\u613F\u586B\u5F97\u76F8\u5F53\u968F\u610F\uFF0C\u672C\u6765\u8111\u5B50\u4E00\u70ED\u60F3\u586B\u4E0A\u4EA4\uFF0C\u8FD8\u597D\u7ADE\u8D5B\u6559\u7EC3\u5E2E\u6211\u51B7\u9759\u4E86\u4E00\u628A\u201C\u4F60\u4E0A\u4EA4\u80AF\u5B9A\u521D\u5BA1\u90FD\u8FC7\u4E0D\u4E86\uFF0C\u8FD8\u662F\u586B\u4E2A\u6982\u7387\u9AD8\u4E00\u70B9\u7684\uFF0C\u522B\u6D6A\u8D39\u673A\u4F1A\u201D\uFF08\u7ED3\u679C\u6211\u6821\u90A3\u5E74\u4E0A\u4EA4\u81EA\u62DB\u4F3C\u4E4E\u5168\u519B\u8986\u6CA1\uFF09\u3002\u7B2C\u4E8C\u5929\u6211\u8D70\u51FA\u6559\u5BA4\uFF0C\u770B\u5230\u6559\u5BA4\u95E8\u5916\u8D34\u6765\u7ED9\u5B66\u751F\u6253\u9E21\u8840\u7684\u9AD8\u6821\u7167\u7247\uFF0C\u7A81\u7136\u89C9\u5F97\u201C\u8BF6\u540C\u6D4E\u8FD9\u540D\u5B57\u771F\u597D\u542C\u201D\uFF0C\u9042\u62A5\u4E86\u540D\u3002</p><p>\u56E0\u4E3A\u5E76\u4E0D\u600E\u4E48\u60F3\u6765\u8FD9\u5B66\u6821\uFF0C\u4E8E\u662F\u81EA\u62DB\u4E5F\u8003\u5F97\u76F8\u5F53\u968F\u610F\uFF0C\u9762\u8BD5\u7684\u65F6\u5019\u8FD8\u8BF4\u4E86\u4E9B\u5947\u602A\u7684\u8BDD\uFF0C\u7ED3\u679C\u5C45\u7136\u8FD8\u662F\u7ED9\u4E86\u964D\u5206\u3002</p><p>\u518D\u7136\u540E\uFF0C\u5373\u4F7F\u4EE5\u6211\u5F53\u65F6\u90A3\u4E2A\u7CDF\u7CD5\u7684\u9AD8\u8003\u6210\u7EE9\uFF0C\u6211\u4F9D\u7136\u6709\u66F4\u60F3\u53BB\u4E14\u6211\u4E5F\u80FD\u53BB\u7684\u5B66\u6821\uFF0C\u6700\u540E\u4F1A\u6765\u540C\u6D4E\u5F88\u5927\u7A0B\u5EA6\u4E0A\u662F\u56E0\u4E3A\u6211\u6297\u4E89\u5230\u6700\u540E\u5B9E\u5728\u592A\u7D2F\u4E86\uFF0C\u89C9\u5F97\u7B97\u4E86\u5427\u5C31\u8FD9\u513F\u4E86\u5427\uFF0C\u7136\u540E\u586B\u4E86\u5FD7\u613F\uFF0C\u5C18\u57C3\u843D\u5B9A\u3002</p><p>\u8FD9\u4E48\u770B\u6765\uFF0C\u90A3\u4E2A\u590F\u5929\u7684\u786E\u76F8\u5F53\u795E\u5947\u3002</p><p>\u4E8E\u662F\u672C\u79D1\u751F\u6DAF\u4EE5\u6765\u4E86\u4E00\u4E2A\u4E0D\u592A\u60F3\u6765\u5374\u53C8\u89C9\u5F97\u81EA\u5DF1\u4E0D\u914D\u6765\u7684\u5B66\u6821\u5F00\u59CB\uFF0C\u53C8\u4EE5\u4E00\u4E2A\u5927\u6982\u5BF9\u4E0D\u592A\u8D77\u5F53\u5E74\u7684\u964D\u5206\u673A\u4F1A\u7684\u6BD5\u4E1A\u72B6\u6001\u7ED3\u675F\u3002\u6211\u540C\u6837\u5728\u6BD5\u4E1A\u8BBA\u6587\u81F4\u8C22\u91CC\u5199\uFF0C\u5E0C\u671B\u6211\u8FD9\u56DB\u5E74\u7684\u6210\u957F\u80FD\u591F\u5BF9\u5F97\u8D77\u540C\u6D4E\u5F53\u5E74\u7684\u9009\u62E9\uFF0C\u4F46\u6211\u5FC3\u91CC\u6E05\u695A\u80AF\u5B9A\u662F\u5BF9\u4E0D\u8D77\u7684\u3002</p><p>\u53EF\u6211\u603B\u4E0D\u80FD\u771F\u7684\u628A\u8FD9\u4E2A\u60F3\u6CD5\u5199\u8FDB\u8BBA\u6587\u91CC\u3002</p><hr><p>\u6BD5\u4E1A\u7684\u90A3\u5929\uFF0C\u6211\u4EE5\u641E\u7838\u4E86\u4E00\u5806\u4E8B\u7684\u72B6\u6001\u8FDB\u5165\u4E86\u5931\u5B66\u5931\u4E1A\u65E0\u4E1A\u6E38\u6C11\u671F\u3002\u5728\u627E\u5730\u65B9\u6536\u7559\u6211\u7684\u60CA\u614C\u5931\u63AA\u4E2D\uFF0C\u6211\u7B2C\u4E00\u6B21\u5B8C\u6574\u7684\u56DE\u987E\u4E86\u6211\u8FC7\u53BB\u90A3\u4E48\u591A\u5E74\u6765\u7684\u6D51\u6D51\u5669\u5669\u548C\u504F\u6267\u987D\u56FA\u3002</p><p>\u5927\u6982\u6211\u7684\u4E00\u5207\u52AA\u529B\u548C\u6323\u624E\u53EA\u662F\u4E3A\u4E86\u8BA9\u81EA\u5DF1\u80FD\u597D\u53D7\u4E00\u70B9\uFF0C\u4F46\u5374\u6323\u624E\u9519\u4E86\u65B9\u5411\u3002\u6211\u627E\u4E86\u4E00\u5757\u5927\u77F3\u5934\uFF0C\u5728\u4E0A\u9762\u523B\u4E86\u201C\u6211\u8BA8\u538C\u4EBA\u7C7B\u201D\u51E0\u4E2A\u5927\u5B57\uFF0C\u7136\u540E\u8E72\u5728\u8FD9\u4E2A\u77F3\u5934\u65C1\u8FB9\u9003\u907F\u4E00\u5207\u95EE\u9898\uFF0C\u4EE5\u4E3A\u8FD9\u6837\u5C31\u80FD\u8FC7\u5F97\u8F7B\u677E\u4E00\u70B9\u3002\u4F46\u7ED3\u679C\u662F\u6211\u5F97\u5929\u5929\u751F\u6D3B\u5728\u5BF9\u5931\u53BB\u6211\u6240\u559C\u6B22\u7684\u4EBA\u4E8B\u7269\u7684\u6050\u60E7\u4E2D\uFF0C\u6700\u8BA9\u4EBA\u6050\u60E7\u7684\u662F\u90A3\u4E9B\u4EBA\u4E8B\u7269\u8FD8\u771F\u5927\u591A\u6570\u90FD\u79BB\u5F00\u6211\u4E86\uFF0C\u7B80\u76F4\u8BA9\u6211\u60F3\u628A\u5B83\u5B9A\u4E49\u4E3A\u201C\u9B54\u5492\u201D\u8FD9\u79CD\u5728\u9B54\u6CD5\u4F4D\u9762\u624D\u4F1A\u6709\u7684\u4E1C\u897F\u3002</p><p>\u4E03\u6708\u5FEB\u7ED3\u675F\u7684\u65F6\u5019\uFF0C\u6211\u7EC8\u4E8E\u5F00\u59CB\u89C9\u5F97\u6211\u53EF\u80FD\u672C\u6765\u53EF\u4EE5\u8FC7\u4E0A\u66F4\u597D\u7684\u751F\u6D3B\uFF0C\u6211\u672C\u6765\u53EF\u4EE5\u7559\u4F4F\u90A3\u4E9B\u6211\u559C\u6B22\u7684\u4EBA\u4EEC\uFF0C\u6211\u672C\u6765\u53EF\u4EE5\u4E0D\u7528\u773C\u7741\u7741\u5730\u770B\u7740\u90A3\u4E9B\u5149\u8292\u6563\u53BB\u3002\u6211\u5E76\u4E0D\u7B97\u4EC0\u4E48\u5F88\u6709\u8FFD\u6C42\u7684\u4EBA\uFF0C\u6211\u53EA\u662F\u60F3\u8FC7\u5F97\u597D\u4E00\u70B9\u800C\u5DF2\uFF0C\u90A3\u8FD9\u53C8\u6709\u4EC0\u4E48\u96BE\u7684\u3002</p><p>\u6211\u672C\u6765\u4EE5\u4E3A\u81EA\u5DF1\u591A\u5C11\u8FD8\u662F\u7559\u4F4F\u4E86\u4E00\u4E9B\u4EBA\uFF0C\u4F46\u8BA4\u771F\u60F3\u60F3\uFF0C\u662F\u4ED6\u4EEC\u9876\u7740\u6211\u8EAB\u8FB9\u90A3\u5757\u76F8\u5F53\u4E0D\u53CB\u597D\u7684\u5927\u77F3\u5934\u7684\u538B\u529B\uFF0C\u5374\u4F9D\u7136\u6CA1\u6709\u79BB\u5F00\u3002\u4ED6\u4EEC\u4E00\u8FB9\u624B\u628A\u624B\u6559\u6211\u600E\u4E48\u5F53\u4E2A\u522B\u90A3\u4E48\u5B85\u90A3\u4E48\u4E27\u90A3\u4E48\u908B\u9062\u90A3\u4E48\u96BE\u76F8\u5904\u7684\u6B63\u5E38\u4EBA\uFF0C\u4E00\u8FB9\u8BA9\u6211\u6709\u4E86\u201C\u5373\u4F7F\u6211\u6C38\u8FDC\u4E5F\u6539\u4E0D\u8FC7\u6765\u4E5F\u4F9D\u7136\u6709\u4EBA\u559C\u6B22\u6211\u201D\u7684\u5E95\u6C14\uFF08\u5F53\u7136\u4E5F\u6709\u53EF\u80FD\u662F\u9519\u89C9 2333\uFF09\u3002</p><p>\u73B0\u5728\u60F3\u6765\uFF0C\u5373\u4F7F\u6211\u5728\u8FC7\u53BB\u7684\u516D\u4E03\u5E74\u91CC\u60C5\u7EEA\u72B6\u6001\u4E3A\u4EBA\u5904\u4E8B\u793E\u4EA4\u6280\u80FD\u90FD\u7CDF\u7CD5\u900F\u9876\uFF0C\u5373\u4F7F\u6211\u8D1F\u80FD\u91CF\u5F97\u9AD8\u4E2D\u5927\u5B66\u90FD\u6709\u4EBA\u89C9\u5F97\u6211\u4F1A\u53BB\u8DF3\u697C\uFF0C\u5373\u4F7F\u6211\u5929\u5929\u90FD\u5728\u6050\u60E7\u4ECA\u5929\u4F1A\u4E0D\u4F1A\u53C8\u6709\u4EC0\u4E48\u79BB\u6211\u800C\u53BB\uFF0C\u5373\u4F7F\u6211\u8FDE\u5F88\u591A\u4EE5\u524D\u7684\u670B\u53CB\u90FD\u4E0D\u6562\u53BB\u8054\u7CFB\uFF0C\u5374\u8FD8\u4ECE\u6765\u6CA1\u6709\u4E00\u6B21\u62C5\u5FC3\u8FC7\u6709\u4E00\u5929\u6211\u5934\u9876\u90A3\u7247\u5929\u7A7A\u4F1A\u5F7B\u5E95\u6697\u4E0B\u53BB\u3002</p><p>\u6211\u8FD9\u79CD\u4EBA\u5C45\u7136\u4F1A\u6709\u8FD9\u79CD\u81EA\u4FE1\uFF0C\u60F3\u60F3\u5C31\u89C9\u5F97\u592A\u5962\u4F88\u4E86\u3002</p><p>\u8FD9\u4E9B\u8BDD\u5927\u6982\u5E94\u8BE5\u5728\u6BD5\u4E1A\u7684\u90A3\u5929\u5C31\u5BF9\u90A3\u4E9B\u5728\u6211\u8EAB\u8FB9\u6216\u4E0D\u5728\u6211\u8EAB\u8FB9\u7684\u4EBA\u4EEC\u8BF4\u51FA\u6765\uFF0C\u4F46\u90A3\u5929\u5927\u5BB6\u90FD\u5F88\u5F00\u5FC3\uFF0C\u800C\u6309\u6211\u7684\u793E\u4EA4\u80FD\u529B\u7684\u6B63\u5E38\u6C34\u5E73\u5927\u6982\u7387\u4F1A\u641E\u7838\u5F00\u5FC3\u7684\u573A\u9762\uFF0C\u4E8E\u662F\u8FD8\u662F\u5565\u4E5F\u6CA1\u8BF4\u3002</p><p>\u90A3\u4E00\u5929\u5BA4\u53CB\u4EEC\u6293\u7740\u65E0\u6570\u6B21\u8868\u8FBE\u8FC7\u201C\u6211\u4E0D\u559C\u6B22\u7167\u76F8\u201D\u7684\u6211\u53BB\u7167\u4E86\u6BD5\u4E1A\u7167\uFF0C\u6211\u5F97\u8BF4\u5979\u4EEC\u76F8\u5F53\u82F1\u660E\uFF0C\u90A3\u5927\u6982\u662F\u7167\u7834\u6211\u7684\u5929\u7075\u76D6\u7684\u7B2C\u4E00\u675F\u66D9\u5149\u3002</p><p>\u539F\u6765\u53EA\u8981\u6211\u60F3\u5F00\u5FC3\uFF0C\u8FD8\u662F\u5F88\u5BB9\u6613\u5C31\u80FD\u5F00\u5FC3\u8D77\u6765\u7684\u3002</p><p>\uFF08\u5F53\u7136\u5E76\u6CA1\u6709\u6211\u73B0\u5728\u5C31\u559C\u6B22\u7167\u76F8\u4E86\u7684\u610F\u601D</p><hr><p>\u552F\u4E00\u9057\u61BE\u7684\u53EA\u662F\u9519\u8FC7\u4E86\u5357\u95E8\u7684\u90A3\u4E9B\u6A31\u82B1\uFF0C</p><p>\u548C\u8BA9\u4F60\u4EEC\u5728\u6211\u6700\u7CDF\u7CD5\u7684\u65F6\u5019\u8BA4\u8BC6\u4E86\u6211\u3002</p><hr><p>\u5176\u4ED6\u7684\u6539\u53D8\u5927\u6982\u5C31\u662F\u4E9B\u9E21\u6BDB\u849C\u76AE\u7684\u4E8B\u4E86\uFF0C\u6BD4\u5982\u8DDF\u5BFC\u5E08\u6362\u5230\u4E86\u4E00\u4E2A\u8D3C\u7406\u8BBA\u7684\u4EE5\u524D\u4ECE\u6CA1\u60F3\u8FC7\u6211\u4F1A\u53BB\u78B0\u7684\u7814\u7A76\u65B9\u5411\u3002\u8001\u5E08\u4F3C\u4E4E\u662F\u4E2A\u8D1F\u80FD\u91CF\u7EC8\u7ED3\u8005\uFF0C\u7ECF\u5E38\u8DDF\u6211\u8FDB\u884C\u7C7B\u4F3C\u4E8E\u201C\u6211\u8981\u662F\u60F3\u4E0D\u51FA\u6765 idea \u8BE5\u600E\u4E48\u529E\u201D\u201C\u90A3\u4F60\u4E5F\u5C31\u6CA1\u6709\u5FC5\u8981\u8BFB\u7814\u7A76\u751F\u4E86\u201D\u7684\u5BF9\u8BDD\u3002</p><p>\u7B97\u4E86\u7B97\u4E86\u4E27\u4EC0\u4E48\u4E27\u597D\u597D\u5E72\u6D3B\u3002</p><p>\u6BD4\u5982\u53BB\u70EB\u4E86\u5934\u53D1\uFF0C\u867D\u7136\u5F88\u591A\u4EBA\u6839\u672C\u770B\u4E0D\u51FA\u6765\uFF0C\u53EA\u662F\u89C9\u5F97\u6211\u7684\u81EA\u7136\u5377\u600E\u4E48\u6362\u4E86\u79CD\u5377\u6CD5\uFF0C\u6240\u4EE5\u6211\u53EF\u80FD\u70EB\u4E86\u4E2A\u5BC2\u5BDE\u3002\u6211\u60F3\u8D77\u521D\u4E2D\u65F6\u6709\u670B\u53CB\u8DDF\u6211\u8BF4\u201C\u6211\u597D\u7FA1\u6155\u4F60\u4EEC\u81EA\u7136\u5377\u7684\u4EBA\uFF0C\u4F60\u4EEC\u4EE5\u540E\u53EF\u4EE5\u4E0D\u7528\u70EB\u5934\u53D1\u201D\u3002\u7ED3\u679C\u6211\u70EB\u5934\u53D1\u8FD8\u5F97\u5148\u62C9\u76F4\u518D\u70EB\uFF0C\u82B1\u53CC\u500D\u7684\u529B\u6C14\u6298\u817E\u3002</p><p>\u7FA1\u6155\u4F60\u4E2A\u5927\u5934\u9B3C\uFF0C\u6454 \uFF08\u256F\u2018\u25A1\u2032\uFF09\u256F\u2558\u2550\u255B</p><p>\u6BD4\u5982\u7EC8\u4E8E\u8BA4\u8BC6\u5230\u4E86\u4E3A\u4EC0\u4E48 GitHub \u88AB\u79F0\u4E3A\u201C\u793E\u4EA4\u5E73\u53F0\u201D\u3002</p><p>\u6BD4\u5982\u6E9C\u51FA\u53BB\u73A9\u7684\u9891\u7387\u589E\u52A0\u4E86\u5F88\u591A\uFF0C\u867D\u7136\u5F88\u591A\u65F6\u5019\u53EA\u662F\u201C\u6362\u4E86\u4E2A\u5730\u65B9\u5B85\u7740\u201D\uFF0C\u4F46\u8FD8\u662F\u6709\u8FDB\u6B65\u561B\u6709\u8FDB\u6B65\u3002</p><p>\u6BD4\u5982\u7EC8\u4E8E\u5F00\u59CB\u770B\u670B\u53CB\u5708\u4E86\uFF0C\u867D\u7136\u539F\u5B9A\u8BA1\u5212\u662F\u4E09\u5929\u81F3\u5C11\u770B\u4E00\u6B21\uFF0C\u4F46\u5B9E\u9645\u4E0A\u7ECF\u5E38\u4E00\u8FDE\u534A\u4E2A\u591A\u6708\u90FD\u4E0D\u60F3\u770B\uFF0C\u4F46\u8FD8\u662F\u6709\u8FDB\u6B65\u561B\u6709\u8FDB\u6B65\u3002</p><p>\u518D\u7136\u540E\uFF0C\u5F88\u5F00\u5FC3\u80FD\u591F\u770B\u5230\u5F88\u591A\u670B\u53CB\u4EEC\u5728 2020 \u7684\u540E\u671F\u90FD\u5F00\u5FC3\u4E86\u8D77\u6765\u3002\u6211\u4E00\u76F4\u89C9\u5F97\u90A3\u4E48\u4E27\u7684\u4EBA\u6709\u6211\u4E00\u4E2A\u5C31\u591F\u4E86\uFF0C\u4F46\u9664\u4E86\u5C2C\u804A\u4EE5\u5916\u6211\u4E5F\u505A\u4E0D\u4E86\u4EC0\u4E48\uFF0C\u6211\u8981\u662F\u80FD\u628A\u4F60\u4EEC\u63A8\u51FA\u53BB\uFF0C\u6211\u4E3A\u5565\u4E0D\u63A8\u6211\u81EA\u5DF1\u51FA\u53BB\u30022020 \u76F8\u5F53\u7684 surreal\uFF0C\u4F60\u4EEC\u80FD\u5728\u8FD9\u4E00\u5E74\u91CC\u71AC\u51FA\u5934\uFF0C\u662F\u4EF6\u975E\u5E38\u4E0D\u5BB9\u6613\u7684\u4E8B\u3002</p><p>\u6211\u5E0C\u671B\u80FD\u6210\u4E3A\u4E00\u4E2A\u5728\u8FD9\u79CD\u65F6\u5019\u80FD\u505A\u70B9\u4EC0\u4E48\u4E8B\u7684\u6E29\u6696\u7684\u4EBA\uFF0C\u867D\u7136\u4EE5\u6211\u76EE\u524D\u7684\u6C34\u5E73\uFF0C\u5927\u6982\u5F97\u5148\u4ECE\u4E00\u4E2A\u6B63\u5E38\u4E00\u70B9\u7684\u4EBA\u5F00\u59CB\u505A\u8D77\u3002</p><hr><p>\u5373\u4F7F\u73B0\u5728\u8BA9\u6211\u56DE\u5230\u9AD8\u4E2D\u6BD5\u4E1A\u65F6\u518D\u9009\u4E00\u904D\uFF0C\u6211\u53EF\u80FD\u4F9D\u7136\u4E0D\u4F1A\u9009\u62E9\u6765\u540C\u6D4E\uFF0C\u6211\u603B\u65E0\u6CD5\u6446\u8131\u201C\u6362\u4E2A\u5927\u5B66\u4F1A\u4E0D\u4F1A\u5C31\u80FD\u8FC7\u5F97\u66F4\u597D\u4E00\u70B9\u201D\u7684\u60F3\u6CD5\u3002\u4F46\u5BF9\u4E8E\u6211\u5728\u8FD9\u91CC\u6536\u83B7\u5230\u7684\u8BA4\u8BC6\u5230\u7684\u4E00\u5207\uFF0C\u6211\u4F9D\u7136\u5FC3\u6000\u611F\u6FC0\u4E0E\u656C\u610F\u3002</p><p>\u4EBA\u751F\u603B\u6709\u5404\u79CD\u5947\u5947\u602A\u602A\u9057\u61BE\u548C\u540E\u6094\uFF0C\u6211\u5927\u6982\u4E5F\u5F88\u96BE\u6709\u90A3\u79CD\u7EDD\u4E0D\u56DE\u671B\u901D\u53BB\u7684\u8FC7\u5F80\u7684\u5883\u754C\u3002\u4F46\u6211\u4EEC\u7684\u751F\u547D\u6C38\u8FDC\u4E0D\u4F1A\u88AB\u62D8\u56FF\u4E0E\u4E00\u65F6\u4E00\u5730\uFF0C\u8FD9\u4E5F\u662F\u6211\u4EEC\u7B49\u5F85\u4E0B\u53BB\u7684\u52A8\u529B\u3002</p><p>\u65B0\u5E74\u5FEB\u4E50\u670B\u53CB\u4EEC\u3002</p><hr><p>\u6700\u540E\u7684\u6700\u540E\uFF0C\u5E0C\u671B\u4ECA\u5E74\u4E0D\u8981\u518D\u5931\u5B66\u4E86\u3002</p>",44);function _(a,c){return t}var h=r(e,[["render",_]]);export{h as default};
